    "headlineNews": "Kirk Cousins completed 22-of-32 passes for 244 yards and three scores in Minnesota's 34-33 Week 2 loss to the Cardinals.\n",
    "report": "",
    "analysis": "Cousins opened Sunday with a touchdown pass on three of Minnesota's first four possessions, finding K.J. Osborn (5/91/1), Justin Jefferson (6/65/1), and Adam Thielen (6/39/1) to trail within one point (24-23) after two quarters. Albeit a sluggish second half, Cousins got the ball back with 2:09 remaining then drove Minnesota's offense 58 yards down the field only to watch Greg Joseph push the game-winning field goal try wide right from 37 yards out. Cousins doesn't typically offer a rushing floor but he has quietly thrown multiple touchdown passes in 10 of his last 11 starts dating back to last year. He'll be a terrific streaming option yet again in Week 3 against Seattle.\n",
