    "headlineNews": "Josh Allen has completed 33.3 percent of his pass attempts of 10-25 yards through Week 2.\u00a0\n",
    "report": "",
    "analysis": "That marks a massive drop off from Allen's intermediate passing accuracy in 2020, a key to his development as a passer. Last year, Allen completed 62.5 percent of his attempts between 10 and 25 yards beyond the line of scrimmage -- a 12 percent improvement over his 2019 numbers. \"This has been, by far, the most significant swing of Allen\u2019s passing profile,\" said The Athletic's Joe Buscaglia. \"While some throwaways need to be accounted for, this is still not what you want to see.\" Allen's adjusted completion rate, as measured by Pro Football Focus, has also dipped in the young 2021 season. His adjusted completion rate stands at 69.4 percent, about 10 percent lower than his 2020 rate. The results of his early-season passing regression are evident in his fantasy output. Allen is the QB19 through Week 2.\u00a0\n",
