    "headlineNews": "Sam Darnold completed 23-of-34 passes for 304 yards, zero touchdowns and zero interceptions in the Panthers' 24-9, Week 3 win over the Texans, adding eight carries for 11 additional yards and two touchdowns.\u00a0\n",
