    "analysis": "The 300-yard effort was Darnold's second in five days, already bringing him halfway to the total he posted in three years as a Jet. Darnold was consistently posting chunk gains through the air this evening, notching six conversions of 20-plus yards. In the \"what might have been?\" category, Darnold had a 33-yard run called back by holding and overshot D.J. Moore on a potential 51-yard touchdown. Darnold's production has come against the softest of schedules, but it's not like big numbers in good spots could be taken for granted when he was in New York. He is passing every test so far, mostly avoiding turnover-worthy plays, locking onto scintillating fourth-year pro Moore, and even showing juice on the ground, where he now has three scores. The Cowboys will be his toughest test thus far in Week 4, but not from a defensive perspective. Darnold will finally be forced to match scores with someone. That is where mistakes start to get made. He will find himself on the QB1/2 borderline.\n",
