    "headlineNews": "Patrick Mahomes completed 24-of-31 passes for 343 yards with three touchdowns and an interception in Kansas City's Week 2 loss to the Ravens.\n",
    "report": "",
    "analysis": "Mahomes collapsed late in the fourth quarter, throwing a costly interception trying to avoid a sack that gave the Ravens the lead. He was on his way to rebounding on the next drive, but a Clyde Edwards-Helaire fumble allowed the Ravens to seal the win. With the Ravens taking away Tyreek Hill, Mahomes completed a pass to nine different receivers. Mahomes has played at an MVP level through the first two games, throwing for 680 yards with a 6:1 TD/INT ratio. He'll faceoff with Justin Herbert\u00a0in another potential shootout with the Chargers in Week 3.\n",
