    "headlineNews": "Teddy Bridgewater completed 26-of-34 passes for 328 yards and two touchdowns in Denver's 23-13 Week 2 win over Jacksonville.\u00a0\n",
    "report": "",
    "analysis": "It was the second consecutive turnover-free game for Bridgewater, who attacked Jacksonville's secondary over the top throughout the afternoon. He didn't register his first incompletion until the 11:54 mark in the second quarter, flailing an underthrown pass to Courtland Sutton (9/159) downfield. Teddy eventually closed the half\u00a015-of-21 for 184 yards and one score, finding Tim Patrick (3/37/1) for a 12-yard touchdown to give Denver a 10-7 lead at the half. Noah Fant's (4/33/1) score to open the third quarter was all Denver needed to seal this one early. Given his (surprising) aggressiveness through the air thus far, Bridgewater will arguably make for a high-end QB2 in next week's matchup against the injury-riddled Jets.\n",
