    "headlineNews": "Dak Prescott completed 23-of-27 passes for 237 yards and an interception in the Cowboys' 20-17, Week 3 win over the Chargers.\n",
    "report": "",
    "analysis": "Prescott didn't score for the first time in seven full games. He led the Cowboys on two scoring drives in the first quarter, both of which ended in rushing touchdowns, but spent the rest of the game giving way to Greg\u00a0Zuerlein. The veteran kicker scored Dallas's final six points and notched a game-winner. Prescott also took two sacks and didn't register a rush attempt. It wasn't the prettiest outing but Prescott got the win and should turn things around in Week 3. He faces an Eagles defense that just lost its best pass-rusher, Brandon Graham, to a torn Achilles' tendon.\n",
