    "headlineNews": "Davis Mills completed 19-of-28 passes for 168 yards, one touchdown and zero interceptions in the Texans' 24-9, Week 3 loss to the Panthers.\u00a0\n",
    "report": "",
    "analysis": "Making his first career start, the No. 67 overall pick absorbed one bone-crushing hit after another, taking four sacks and nine hits by FOX's count. It was frankly unclear how Mills got up from several of his knocks, especially in the second half as the Panthers pinned their ears back. The box score says Mills committed zero turnovers, but he plainly fumbled in the fourth quarter. Somehow, some way, it was ruled an incomplete pass. He tried to put the ball on the ground several other times. Predictably, the Texans weren't letting Mills so much as look down the field before falling behind by two scores after the break. Mills wasn't awful with the restrictor plate off, finding Brandin Cooks for a few nice gains. The problem is, Cooks remains the Texans' only weapon. Mills has another brutal Week 4 matchup in the Bills, where he will offer zero DFS or streaming appeal.\u00a0\n",
