    "headlineNews": "Aaron Rodgers completed 22-of-27 passes for 255 yards and four touchdowns in the Packers' 35-17, Week 2 win over the Lions Monday night.\n",
    "report": "",
    "analysis": "The panic button was smashed after the Packers got blown out 38-3 by the Saints in Week 1 when Rodgers completed just 15 balls for 133 scoreless yards and a pair of picks. But he predictably bounced back in a big way in a home date with the rebuilding Lions in town. Three of Rodgers' four scores were four-, one-, and 11-yard hookups with Aaron Jones with the fourth going to Robert Tonyan. Rodgers also got Davante Adams back involved with an 8-121 line on a team-high nine looks. Rodgers actually left some big plays out there, missing Marquez Valdes-Scantling on a number of deep shots where he beat the cornerback over the top. Rodgers will get a tough Week 3 road test at the 49ers.\n",
