    "headlineNews": "Matt Ryan completed 35-of-46 passes for 300 yards, two touchdowns and three interceptions in the Falcons' 48-25, Week 2 loss to the Bucs.\u00a0\n",
    "report": "",
    "analysis": "Ryan stuffed the box score more than he did in Week 1, but that includes with interceptions. Two of his picks were housed for six points, devastating a nascent Falcons comeback attempt in the second half. The miscues came in the span of four minutes, with one ricocheting off a defensive lineman's hands and the other coming on a jumped route. Ryan once again had trouble finding top weapons Kyle Pitts and Calvin Ridley for big plays, though both compiled more than they did in the opener. Ryan has almost no athleticism left behind a horrid offensive line. This is going to get worse before it gets better, which may be never. The Giants are a potentially problematic Week 3 road date, though Taylor Heinicke had little trouble with the G-Men in Week 2.\u00a0\n",
