    "logoUrl": "https://a.espncdn.com/i/teamlogos/nfl/500/no.png",
    "headlineNews": "Jameis Winston completed 11-of-22 passes for 111 yards, zero touchdowns and two interceptions in the Saints' 26-7, Week 2 loss to the Panthers, adding three carries for 19 yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "It was a horrific game all around for the Saints, who were held to 128 yards of total offense, the lowest of the Sean Payton era and the franchise's worst mark since 1996. Having no established targets hierarchy and shaky protection against a thundering Panthers front seven, Winston was utterly abysmal, with both his interceptions the kind of bone-headed throws he was routinely mocked for in Tampa. INT No. 1 was a desperation heave falling backward that landed in a crowd of three Panthers. No. 2 came after Winston climbed the pocket and blindly chucked the ball down the field. Payton is going to be livid watching the film. Despite Winston's negative play, Taysom Hill mixed in for only two touches. Winston has maybe the worst potential Week 3 bounce-back spot in a road trip to New England.\u00a0\n",
