    "analysis": "Kamara was running into brick walls against a Panthers defense that has been ferocious through two games, though Jameis Winston and the Saints' passing game were not making things any easier for their running back. The Saints simply have zero reliable targets beyond Kamara, and it was not difficult for the Panthers to diagnose what was happening on any given snap. It was still surprising to see Kamara limited to eight carries one week after he reached 20 for only the second time in his career. The Saints have a lot to work through ahead of next Sunday's foreboding New England road trip. Despite today's disaster, Kamara remains a cinch RB1 as a game-proof player who will be funneled all of his team's most important touches.\u00a0\n",
