    "headlineNews": "Marquez Callaway caught 2-of-4 targets for eight yards in the Saints' Week 2 loss to the Panthers.\u00a0\n",
    "report": "",
    "analysis": "The Saints' passing attack was dead on arrival today, with Jameis Winston completing only 11 throws in a 26-7 loss. The protection wasn't amazing while the Panthers' defensive line was, but the biggest problem was probably the Saints' lack of a targets hierarchy. Winston simply has no clue who to turn to at any given moment, and Callaway is not forcing the issue after his strong summer and preseason. He now has three grabs on six targets through two contests, and has a dreadful Week 3 road matchup in the Patriots. Fantasy managers hard up for roster spots could already make a drop call, but Callaway is probably worth riding out for another week or two if you don't have an acute need. Someone has to catch passes in this offense, and Michael Thomas remains at least a month away.\u00a0\n",
