    "report": "",
    "analysis": "Carroll said the addition of Everett to Seattle's offense gives the team \"the fanciest, sweetest-looking receiver/tight end mix that we\u2019ve had.\" \"He\u2019s like a wide receiver, he\u2019s got terrific after-the-catch run ability, really aggressive and he\u2019s a good blocker, too, and he knows the system inside and out,\" Carroll said of Everett, who followed new Seahawks offensive coordinator Shane Waldron from the Rams. Everett largely split snaps with Tyler Higbee last year in LA, catching 41 of 62 targets for 417 yards and a touchdown. There remains a chance he could share the tight end pass-catching role with Will Dissly this season.\u00a0The Athletic's Michael-Shawn Dugar said in March that\u00a0Dissly \"may be in position to hold the top spot\" on the Seahawks' depth chart, even after the Everett signing. Everett's athleticism, after-the-catch ability, and familiarity with Waldron gives him the edge to lead Seattle tight ends in targets and catches. Everett is a solid late-round stacking partner with Russell Wilson in best ball leagues.\u00a0\n",
